import React, { Component } from "react";
import { Link } from "react-router-dom";
import logo from "../../img/logo-with-text.png";
import "./style.css";

class Footer extends Component {
  // JSX stuff
  render() {
    return (
      <section id="footer">
        <footer className="page-footer font-small blue pt-4">
          <div className="container">
            <div className="row">
              {/* Logotipo */}
              <section className="col-md-6 text-center">
                <i className="fab fa-facebook-f  white-text text-center" />
              </section>

              {/* Seção de contatos */}
              <section className="fale-conosco col-md-3">
                <h1 className="title">Fale conosco</h1>
                <ul className="list-unstyled">
                  <li>
                    <i className="fas fa-envelope mr-2" />{" "}
                    primecodes.org@gmail.com
                  </li>
                  <li>
                    <i className="fas fa-phone mr-2" /> +55 061 99116-9967
                  </li>
                  <li>
                    <i className="fas fa-phone mr-2" /> +55 000 99999-9999
                  </li>
                </ul>
              </section>

              {/* Seção de Links */}
              <section className="fale-conosco col-md-3">
                <h1 className="title">Links rápidos</h1>
                <ul className="list-unstyled">
                  <li>
                    <Link className="link">Orçamentos para Sites</Link>
                  </li>
                  <li>
                    <Link className="link">Orçamentos para Design Gráfico</Link>
                  </li>
                  <li>
                    <Link className="link">Realizar um orçamento</Link>
                  </li>
                </ul>
              </section>
            </div>
          </div>

          {/* Copyright */}
          <div class="footer-copyright text-center py-3">
            © 2019 Copyright - PrimeCodes
          </div>
          {/* Copyright */}
        </footer>
      </section>
    );
  }
}

export default Footer;
